(5, 'Apple Macbook Core 2 Duo Dd120 2 Ram 2.16 Ghz Nav12', 'Apple Macbook Core 2 Duo  DD120 2RAM  2.16 GHZ 13.3"" esta a toda prueba.   ENVIO Y ENTREGA:\r\n\r\nPOR MRW,ZOOM CON FLETE PREPAGO\r\n\r\nEL COMPRADOR DEBE SUMARLE AL PRECIO DEL PRODUCTO EL COSTO DEL FLETE Y TASA POSTAL POR MRW,ZOOM\r\n\r\nASI SE TE ENVIA YA CON EL FLETE PAGO\r\n\r\nUNA VEZ CONFIRMADO EL DEPOSITO, EL PRODUCTO SERA ENVIADO EN LA MAYORIA DE LOS CASOS EN 2 DIAS HABILES A MAS TARDAR.EN CASO DE ENVIO EL PRODCUTO SOLO SERA ENVIADO A LA OFICINA DE MRW MAS CERCANA AL DOMICILIO O TRABAJO DEL COMPRADOR PARA QUE LA PASE BUSCANDO', 'Apple Macbook Core 2 Duo Dd120 2 Ram 2.16 Ghz 13.3', 'si', 8800.00, 1, 'usado', 7),
(6, 'Mini Laptop 7 Pulg Wm8650 Android 2.2 Usb 3g Cpu 800 Mhz', 'Nuevo Modelo en Oferta!!!\r\n\r\n\r\nMini Laptop Netbook 7 Pulgadas WM 8650\r\nAndroid 2.2 + CPU 800 Mhz + 4gb Memoria\r\nWifi + 3g + 512MB RAM + RJ45 + USB\r\n\r\nDISPONIBLE EN VARIOS COLORES, PREGUNTAR ANTES DE OFERTAR', 'Aceptamos Tarjetas De Debito Y Credito Somos Tienda En Sabana Grande', 'si', 2089.98, 100, 'nuevo', 7),
(7, 'Laptop Lenovo G580 Intel I3 4gb 500gb 15.6 Led Portatil W8', 'Laptop Lenovo G580\r\n\r\nProcesador Intel Core i3 - 3110M 2.4GHz\r\nMemoria Ram 4GB DDR3\r\nDisco Duro de 500GB\r\nPantalla de 15.6"" HD LED\r\nQuemadora DVD\r\nLector de tarjetas 2 en 1\r\nWifi 802.11n\r\nIntel HD 4000 Graphics\r\nPuertos USB 3.0 / 2.0\r\nCamara Web (720p HD)\r\n\r\nLa última tecnología a un precio asequible\r\n\r\nLa Lenovo G580(r) Es una portátil asequible que no compromete, ofrece un rendimiento excepcional para las tareas diarias, gracias a la 3a generación de Intel (r) Core i3, 4GB de memoria RAM y espacio para almacenamiento de 500GB de disco que le permite almacenar gran cantidad de información, imágenes, música y videos.\r\n\r\nTambién cuenta con OneKey Rescue System (r), una cómoda herramienta que hace copias de seguridad y recuperación de datos rápida y fácil.', 'Windows 8 , I3 De Tercera Generacion, Modelo 2013, Nuevas Con Garantia', 'si', 15299.00, 25, 'nuevo', 7),
(8, 'Dell Precicion M6500 Core I7, 16gb Ram, Ati Fire Pro, Nav12', 'Rendimiento incomparable\r\n\r\nConozca la workstation móvil más potente. La Dell Precision M6500 se destaca donde otras workstations móviles comienzan a perder potencia.\r\n\r\nCon especificaciones que algunas workstations de escritorio apenas podrían ofrecer, la workstation móvil emblemática de Dell es una elección ideal para los usuarios más exigentes.\r\n\r\nWindows® 7 Professional Discover virtually unlimited creative power with optional Intel® Core i7 Extreme Edition Quad Core processors, which work in harmony with 1333MHz or 1600MHz DDR3 memory and stunning ATI® FirePro® or NVIDIA® Quadro FX graphics to support your talent.\r\n\r\nEscalabilidad masiva\r\n\r\nIncreíble capacidad de ampliación y flexibilidad. El rendimiento sin procesar es sólo una parte, la Dell Precision M6500 también tiene la capacidad de administrar grandes volúmenes de datos.\r\nWindows 7 Professional\r\nAladmitir cuatro ranuras de memoria DIMM, la M6500 permite una escalabilidad de memoria de hasta 16 GB. Con dos compartimentos de disco duro dedicados y una minitarjeta SSD adicional (¡Próximamente!), la capacidad de almacenamiento de la M6500 puede escalarse hasta más de 1 terabyte y puede ser configurada en modo RAD?5 para operar con alto rendimiento y redundancia.\r\nNumerosas opciones le brindan la flexibilidad para configurar la Dell Precision M6500 exactamente como lo desea. Elija una pantalla opcional integral RGB de LED de 17"" que admite 100% del espectro de colores de Adobe® seleccionables por el usuario, una cámara opcional de 2 MP o un panel multitáctil con ajuste gradual y utilice su workstation como lo desee.', 'Extra Credito Mercantil Y Banesco, Workstation, 500gb Hdd, 17 Led', 'si', 27850.00, 10, 'nuevo', 7),
(9, 'Laptop Siragon Nb3100 Dd 500 Gb Ram 4gb Amd Dual Core', 'Vive tu vida digital de forma brillante\r\nSu innovador diseño con una llamativa tapa exterior semejante a un metal pulido hacen de la NB-3100 una espectacular opción, ya que está hecha pensando en una tendencia vanguardista para ofrecer un producto de gran calidad para aquellos que desean una laptop única en su estilo y que sea el centro de todas las miradas.\r\n\r\nConvierte tus pasatiempos en experiencias\r\ncon gráficos nítidos y brillantes.\r\nElimina prácticamente las esperas en la\r\ntransmisión de vídeos de alta definición.\r\nNavega por Internet a una velocidad increíble\r\ny termina tus tareas con facilidad.\r\nEs tu vida digital, tu manera de vivir,\r\ncon la tecnología VISION de AMD\r\n\r\nLa vida en imágenes\r\nTu laptop NB-3100 te permite disfrutar de todos tus contenidos personales de Alta Definición, ya sean tus peliculas, videos ó fotos en una pantalla grande con una simple conexión HDMI para disfrutar de video y audio con solo conectar un cable.\r\n\r\nAdemás la NB-3100 te permite disfrutar de contenidos multimedia con impecables imágenes mediante diversas tecnologías avanzadas para gráficos, que facilitan la reproducción optimizada de video en alta definición y proporcionan una calidad de imagen superior\r\n\r\nConversa con quien quieras\r\nCasi oculta en la parte superior de la pantalla de la\r\nlaptop NB-3100, hay una VivoCam que podrás usar\r\npara tomar fotos y grabar videos. Lo mejor de\r\ntodo es que no debes perder tiempo valioso\r\ninstalando software o configurando la cámara,simplemente funciona desde el\r\nprimer momento.\r\n\r\nGarantía Síragon\r\nLas laptops Síragon son sometidas a exigentes pruebas de control de calidad durante su proceso de ensamblaje ofreciendo a nuestros clientes un Certificado de Garantía por un año de duración.', 'Somos Tienda Fisica Garantia 1 Año Estamos En Sabana Grand Ry1computes', 'si', 8999.00, 13, 'nuevo', 7),
(10, 'Brazalete Antiestatica El Que Si Funciona!, Envio Economico!', 'Mosca!!!!! LAS PULSERAS INALAMBRICAS NO FUNCIONAN!!\r\n\r\nPuedes buscarlo en Internet. Las pulseras antiestaticas inalambricas son una estafa... no hay forma de que las cargas pasen a tierra sin un conductor que la lleve a tierra.\r\n\r\nLa estatica es una carga electrica que se acumula en el cuerpo con el simple hecho de caminar, y que al tocar un componente electronico lo daña al instante.\r\n\r\nSi trabajas con electronicos es indispensable que tengas uno y se detendran esas muertes subitas de partes y componentes que servian y de repente dejaron de servir!\r\n\r\nSe coloca con el caiman en un metal como el case de la computadora y listo!.\r\n\r\nVienen con un broche que permite desconectar el cable de la muñeca sin sacarse la pulsera.', 'Pulsera Anti Estatica Esd, Mejora Tu Desempeño Electronico', 'si', 64.99, 20, 'nuevo', 7),
(11, 'Mini Laptop Isonic Lcd 10 Pulgadas Intel Dual Core N550', 'MEGA OFERTA: MINI LAPTOP ISONIC INTEL DUAL CORE N550 10 PULGADAS LCD. APROVECHEN ESTA OPORTUNIDAD UNICA EN EL MERCADO. SUPER BARATAS\r\n\r\n° PANTALLA LCD DE 10 PULGADAS\r\n° PROCESADOR INTEL DUAL CORE N550\r\n° 500 GB DE DISCO DURO\r\n° 2 GB RAM\r\n° LECTOR DE MEMORIA DE 3 EN 1 (SD, MMC, MS)\r\n° CAMARA WEB 1.3 MPIXEL\r\n° CONEXION INALAMBRICA WIFI 802,11 B/G\r\n° MODELO EXTRA DELGADO \r\n\r\n° GARANTIA: 3 MESES POR DEFECTO DE FABRICA, TODA GARANTIA CORRE POR COSTO DEL COMPRADOR Y DEBE TRAER SU FACTURA LEGAL.\r\n\r\nFACTURAMOS CON FACTURA SENIAT EMPRESA RESPONSABLE\r\n\r\nAL HACER LA COMPRA DEBE RETIRAR EL PRODUCTO EN 3 DIAS HABILES DE LO CONTRARIO SE LE CALIFICARA NEGATIVO Y TAMBIEN SOMOS TIENDA FISICA Y NOSOTROS HACEMOS ENTREGAS EN PLAZA VENEZUELA SIN NINGUN COSTO ADICIONAL.\r\n\r\nTOTALMENTE NUEVO EN SU CAJA NO DUDES EN OFERTAR', 'UNICA EN EL MERCADO. SUPER BARATAS', 'si', 5999.00, 10, 'nuevo', 7),
(12, 'otente Mini Laptop Atom,wifi,lenovo S100 /2gb/320gb,w7st', 'Portatil LENOVO Netbook Intel Atom S100 N570/2GB/320GB/W7S\r\n\r\n12M De Garantia\r\n\r\nNUEVA CAJA SELLADA\r\n\r\nSUPER OFERTA\r\n\r\n\r\nDescripción:\r\n\r\nIdeaPad S100 (59-303644)\r\n\r\nFunciones principales Procesador Intel® Atom? N570 (1M Cache, 1.66 GHz)\r\n\r\nSistema Operativo Windows® 7 Starter Original\r\n\r\nTarjeta de Video Intel® GMA 3150\r\n\r\nMemoria 2GB (667 MHz) DDR3 - Max. 2GB\r\n\r\nPantalla 10.1"" (1024x600) SD LED / Glossy\r\n\r\nDispositivo de Puntero Touchpad\r\n\r\nDisco Rígido 320GB 5400 rpm\r\n\r\nBatería 3 Celdas Li-Ion (4 horas de duracion aproximadamente)\r\n\r\nConectividad 10/100 Ethernet\r\n\r\nAdaptador Inalámbrico 802.11 b/g/n\r\n\r\nNO INCLUYE Bluetooth Bluetooth®\r\n\r\nDiseño Notebook\r\n\r\nOtros Cámara Web, 3 Puertos USB 2.0, Lector Multitarjeta 2 en 1, VGA, RJ-45.\r\n\r\nColor: Negro\r\n\r\nGarantía 1 año\r\n\r\nContenido en caja: Mini Portatil Lenovo S100, Adaptadorde de Corriene, Bateria\r\n\r\nFORMA DE PAGO:\r\n\r\nTRASFERENCIA \r\nDEPOSITO EN CUENTA\r\nEFECTIVO DIRECTAMENTE EN NUESTRA OFICINA\r\n \r\nENVIOS AL EXTERIOR DE EL PAIS POR:\r\n\r\nCOBRO A DESTINO\r\n\r\nRECUERDE HACER SUS PREGUNTAS\r\nSI TIENE ALGUNA DUDA SOBRE EL PRODUCTO\r\n\r\nNO OFERTE SI NO ESTA 100 SEGURO', 'Portatil Lenovo Netbook Intel Atom S100 N570,2gb,320gb,w7s,nueva,fact', 'si', 8290.00, 5, 'nuevo', 7),
(13, 'Bateria Hp Dv4 Dv5 Dv6 Cq40 Cq50 Cq60 Cq70 G50 G60 G70', 'Baterias para Laptops HP CQ40, CQ50, DV4, DV5, Pavilion G50, G60, G70 y muchas mas...\r\n\r\nTUCONEXIONUSA te trae una variedad de baterias de reemplazo nuevas equivalentes con las especificaciones del fabricante para laptops HP, con garantía y a un precio módico.\r\n\r\n\r\nCaracterísticas:\r\n\r\nNúmero de Referencia: 2458\r\nVoltage: 11.1V\r\nCapacidad: 5200 mAh\r\n\r\nCOMPATIBLE CON:\r\n\r\nSerie CQ40 Serie DV5\r\nSerie CQ50 Serie DV6\r\nSerie CQ60 Pavilion G50\r\nSerie CQ70 Pavilion G60\r\nSerie DV4 Pvilion G70\r\nImportante: Por favor lea la siguiente pregunta de ¿Quién quiere ser millonario?\r\nTendrá la posibilidad de ganarse una calificación positiva en vez de una negativa\r\n\r\nOpción A: Pregunte antes de ofertar.\r\nOpción B: Asegúrate de tener el dinero antes de ofertar.\r\nOpción C: Consulte con sus amigos.\r\nOpción D: Las opciones A, B y C no corresponden a mi situación, estoy listo para comprar.\r\nTérminos y Condiciones Preguntas Frecuentes', 'Baterías para laptop', 'si', 699.99, 40, 'nuevo', 7),
