(20, 'Disco Duro Samsung 250gb Sata 2.5¨ Para Laptop 5400rpm/8m', 'DISCO DURO SAMSUNG 250GB SATA 2.5¨ PARA LAPTOP 5400RPM/8M\r\n\r\nDISPONIBLES UNICAMENTE MARCA TOSHIBA\r\n\r\nConfiguración del Drive Capacidad 250 GB\r\nInterfaz Serial ATA 3.0 Gbps\r\nTamaño del Buffer DRAM 8 MB\r\nByte por Sector 512 bytes\r\nVelocidad de Rotación 5,400 RPM\r\nEspecificaciones de Performance Tiempo Promedio de Búsqueda (típica) 12 ms\r\nDrive Reday Time (Típico) 4 s\r\nEspecificaciones de Confiabilidad Error de Lectura No Recuperable 1 sector en 1014 bits\r\nAcústica Inactivo 2.4 bel\r\nRealizando una Búsqueda 2.6 bel\r\nEspecificaciones Ambientales Temperatura Operando 5 ~ 55ºC\r\nNo Operando -40 ~ 70ºC\r\nHumedad (no condensación) Operando 8 ~ 90%\r\nNo Operando 5 ~ 95%\r\nLiner Shock(1/2 sine pulse) Operando 400 G\r\nNo Operando 900 G\r\nAltitud (relativa al nivel del mar) Operando - 300 a 3,000 m\r\nNo Operando - 300 a 15,000 m\r\nAlimentación Voltaje + 5 V ± 5%\r\nSpin-up Current(Max.) 1,000 mA\r\nBúsqueda (típica) 2.5 W\r\nLectura/Escritura (típica) 2.5 W\r\nInactivo (típica) 0.85 W\r\nStandby (típica) 0.25 W\r\nSleep (típica) 0.2 W\r\nDimensiones Físicas Alto (Max.) 9.5 mm\r\nAncho 69.85 mm\r\nLargo 100 mm\r\nPeso (promedio) 105 g\r\nCOMPRE SEGURO TIENDA FISICA EN CENTRO COMERCIAL CERCA DEL METRO DE SABANA GRANDE\r\n \r\n- PUEDE BUSCAR EL PRODUCTO PERSONALMENTE O LO ENVIAMOS A NIVEL NACIONAL, SOMOS EMPRESA CON TIENDA EN CENTRO COMERCIAL CERCA DE LA ESTACION DEL METRO DE SABANA GRANDE HORARIO DE LUNES A SABADO DE 10:00 AM A 7:00 PM.\r\n \r\n- FORMAS DE PAGO TRANSFERENCIA O DEPOSITO BANCOS BANESCO, CORP BANCA, VENEZUELA, FONDO COMUN, PROVINCIAL, BANPLUS, EXTERIOR, TAMBIEN PUEDE CANCELAR EN EFECTIVO O DEBITO AL MOMENTO DE RETIRAR EL PRODUCTO.\r\n \r\n- PUEDE HACER SUS PREGUNTAS ANTES DE OFERTAR.\r\n \r\n- DESPUES DE OFERTAR TIENE 5 DIAS PARA CONCRETAR LA COMPRA DE LO CONTRARIO SERA CALIFICADO NEGATIVO.', 'TIENDA FISICA EN CENTRO COMERCIAL CERCA DEL METRO DE SABANA GRANDE', 'si'