(21, 'Disco Duro Seagate Barracuda Sata 500gb', 'La Seagate® Desktop HDD es la unidad de disco duro perfecta para todas sus aplicaciones de escritorio. Una unidad para todo lo que necesita, respaldada por la confianza que dan 30 años de rendimiento, fiabilidad y sencillez.\r\n\r\nDiscos duros que reducen sus costes y disparan su capacidad de almacenamiento.\r\nTransición sin problemas a unidades de 3 y 4 TB.\r\nCon tecnología Seagate AcuTrac™, que maximiza las densidades de almacenamiento en disco duro.\r\n\r\nSeagate Desktop HDD: consiga lo que quiera.\r\n\r\nLas unidades de Seagate le ofrecen todas las novedades en almacenamiento que le ayudan a reducir costes e incrementar el almacenamiento.\r\n\r\nLa primera tecnología de disco duro de 1 TB por disco del mercado\r\nLa tecnología OptiCache™ aprovecha aún más el caché de 64 MB de gran tamaño y el potencial de los microprocesadores mejorados\r\nLa tecnología OptiCache™ de Seagate mejora el rendimiento hasta un máximo de 45% con respecto a la generación anterior\r\nLa tecnología 6Gb/s SATA aumenta el rendimiento al máximo\r\nLa tecnología AcuTrac™ de Seagate proporciona un rendimiento de lectura y escritura fiable incluso en los entornos de funcionamiento más exigentes\r\nEl software gratuito DiscWizard™ permite capacidades de más de 2 TB en sistemas con BIOS obsoletas para PC y Windows XP\r\n\r\nPase de los 2 TB sin complicaciones.\r\n\r\n¿Le preocupa ir más allá de los 2 TB? Pues no hay de qué preocuparse. La utilidad DiscWizard™ de Seagate facilita esta transición al máximo:\r\n\r\nEl software gratuito permite a los equipos con Windows utilizar unidades con más de 2 TB.\r\nLa utilidad DiscWizard de Seagate le ofrece un medio para utilizar de forma efectiva sus unidades de disco duro de 3 TB y 4 TB\r\n\r\nMaximiza las densidades de almacenamiento de las unidades de disco duro.\r\n\r\nLa tecnología de 1 TB por disco de Seagate Desktop HDD incorpora 340.000 pistas de disco duro en una anchura de solo una pulgada. Esta densidad de almacenamiento increíble proporciona nuevas posibilidades en cuanto a capacidad y reduce el coste total de almacenamiento.\r\n\r\nLa tecnología AcuTrac™ de Seagate ofrece densidades de almacenamiento con una eficaz lectura y escritura en nanopistas de tan solo 75 nanómetros de ancho. Una dimensión aproximadamente 500 veces más pequeña que el punto final de esta frase.', 'Calidad y rendimiento demostrados.', 'si', 1750.00, 100, 'nuevo', 7),
(22, 'Disco Duro 500 Gb Sata 3.5 Western Digital Nuevo Sellado', 'DISCO DURO SATA MARCA WESTERN DIGITAL NUEVO 500 GB PARA PC 3.5 NUEVO SELLADO DE PAQUETE\r\n\r\n SOMOS TIENDA UBICADA EN SABANA GRANDE CARACAS, EL ARTICULO POSEE 30 DIAS DE GARANTIA.\r\n\r\nCONDICIONES DE GARANTIA:\r\n\r\nSOLO SE CUBRIRA LA GARANTIA POR DEFECTOS DE FABRICA DEL EQUIPO.\r\n\r\nNO CUBRIMOS GARANTIA POR GOLPES, QUEMADURAS EN LA PLACA,SULFATO.\r\n\r\nFORMAS DE PAGO:\r\n\r\nSOLO ACEPTAMOS DEPOSITOS BANCARIOS Y EFECTIVO.\r\n\r\nTRABAJAMOS CON BANESCO Y BANCO DEL TESORO.\r\n\r\nREALIZAMOS ENVIOS AL INTERIOR DEL PAIS CON UN DIA DE ANTELACION, ENVIAMOS EL MISMO DIA SI DEPOSITA EN EFECTIVO ANTES DE LAS 12 DEL MEDIODIA.\r\n\r\nNO OFERTE SI NO ESTA SEGURO DE COMPRAR YA QUE SERA CALIFICADO DE FORMA NEGATIVA AL NO CONCRETARSE LA COMPRA DURANTE LOS PRIMEROS 5 DIAS DESPUES DE LA OFERTA.\r\n\r\nNOTA:EL HORARIO DE TRABAJO ES DE LUNES A SABADO DE 11 AM A 6 PM Y LOS ENVIOS AL INTERIOR DE LUNES A JUEVES ANTES DE LAS 10 AM', '30 Dias Garantia Son De 3.5 Para Pc', 'si', 1650.00, 50, 'nuevo', 7),
(23, 'Toner Compatible Canon 116 Para Mf8050 Mf-8050 8050c 8050cn', 'TONER COMPATIBLE CANON 116 Para Multifuncional MF-8050CN\r\nCaracteristicas del Producto:\r\nColor: Negro\r\nTecnologia de Impresion: Laser\r\nNumero de Paginas: 2.200\r\nImpresoras Compatibles: Canon MF-8050CN,\r\nHP Laserjet CM1312/CP1215/1515/1518/CM1300\r\n\r\nTONER COMPATIBLE CANON 116 Para Multifuncional MF-8050CN Color Cian, Amarillo, Magenta\r\nCaracteristicas del Producto:\r\nColor: Cian, Amarillo, Magenta\r\nTecnologia de Impresion: Laser\r\nNumero de Paginas: 1.400\r\nImpresoras Compatibles: Canon MF-8050CN\r\nHP Laserjet CM1312/CP1215/1515/1518/CM1300\r\n \r\nSON CONSUMIBLES PRE-TESTEADOS, ES DECIR SON PROBADOS ANTES DE SER EMPAQUETADOS, DE CALIDAD Y RENDIMIENTO IGUAL AL ORIGINAL.\r\nNO SON CONSUMIBLES REMANUFACTURADOS, RECARGADOS O REENCAUCHADOS.', 'Articulo Nuevo De Calidad Optima/premium 100% Garantizado', 'si', 670.00, 32, 'nuevo', 7),
