(25, 'Pantalla Tripode Para De Proyector/video Beam 1,78 X 1,78', 'Pantalla de Tripode 1,78x1,78\r\n \r\nMarca: YolkVisual\r\n\r\nInformacion del Producto \r\n\r\n La pantalla de tripode tiene una rapida y facil instalación, es ligera y compacta, por lo que es facil de transportar, o guardar. Todas las pantalla de tripode tienen una varilla de acero flexible ajustable para tensar la tela para asi proporsionar una superficie de visualización lisa y clara. \r\n\r\nLa pantalla de tripode tambien tiene un mecanismo de altura para que se pueda ajustar a los requerimientos del salon donde se va a colocar la pantalla. La pantalla de blanco mate ofrece una superficie de uso general, exelente para salones de clase o salones de entrenamiento, ademas se limpia facil con agua y jabon suave. \r\n\r\nLa pantalla contiene bordes negros, tiene seguro en las patas mecanicas, un mango de plastico y una tablilla de acero con barra de tensión. Fuertes patas de acero proporcionan un soporte maximo pero sigue siendo ligero para la movilización. \r\n\r\nLa relacion precio-calidad, la mejor en el mercado \r\n\r\nEspecificaciones generales \r\nLigera para ser transportado\r\nSuperficie plana y mecanismo de viento\r\npantalla blanco mate, facil de limpiar y soporta el uso diario\r\nMascara negra especial en los bordes para mayor punto de enfoque\r\n\r\nOTROS MODELOS DISPONIBLES...\r\n \r\nPantallas Manuales \r\n Pantallas de Tripode \r\n Pantallas Electricas \r\n\r\n  152x152  \r\n178x178 178x178 178x178\r\n200x200 200x200 200x200\r\n213x213 213x213 213x213\r\n    244x244\r\n   274x274\r\n305x305  305x305', 'Tu Especialista En Proyeccion: Proyectores, Pantallas, Cables, Bases..', 'si', 2799.00, 14, 'nuevo', 7),
