(29, 'Impresora Multifuncional Epson L210 Sistema De Tinta Continu', 'IMPRESORA EPSON L210 CON TANQUE DE TINTAS INCORPORADO\r\n\r\nLa IMPRESORA EPSON L210 es la multifuncional que redefine la economía en las familias activas de hoy.\r\nÚnica con el sistema original de Tanque de Tinta para imprimir cientos de proyectos escolares, páginas Web, fotos y todo lo que quieras sin la molestia de tener que cambiar o recargar un cartucho.\r\nMultifuncional con sistema original de Tanque de Tinta con Impresora, Copiadora y Escáner Costo de impresión ultra bajo Calidad y garantía original Epson.\r\n\r\nCARACTERISTICAS Y BENEFICIOS ADICIONALES\r\nAcceso a una garantía de un año y a la extensa red de servicio y soporte Epson Fácil uso y recarga de tinta Con las tintas incluidas, imprime hasta 4000 páginas en negro ó 6500 páginas a color Calidad de impresión garantizada con la tinta original Epson.\r\nDiseñadas con la más alta calidad para impresiones duraderas. Imprime rápidamente ? hasta 27 ppm en texto negro y 15 ppm en texto a color (borrador) Escáner de 48 bits y 600 x 1200 dpi para ampliaciones de fotos y documentos OCR Regalo: software para edición de documentos OCR Elimina los ojos rojos, restaura el color y contraste de tus fotos, en un sólo clic desde el driver de la impresora o con Epson Easy Photo Print Impresión a doble faz manual para ahorrar papel Con cable USB de regalo\r\nLa L210 es la multifuncional que redefine la economía en las familias activas de hoy. Única con el sistema original de Tanque de Tinta para imprimir cientos de proyectos escolares, páginas Web, fotos y todo lo que quieras sin la molestia de tener que cambiar o recargar un cartucho.\r\nMultifuncional con sistema original de Tanque de Tinta con Impresora, Copiadora y Escáner\r\nCosto de impresión ultra bajo\r\nCalidad y garantía original Epson. Acceso a una garantía de un año** y a la extensa red de servicio y soporte Epson\r\nFácil uso y recarga de tinta\r\nCon las tintas incluidas, imprime* hasta 4000 páginas en negro ó 6500 páginas a color\r\nCalidad de impresión garantizada con la tinta original Epson. Diseñadas con la más alta calidad para impresiones duraderas.\r\nImprime rápidamente – hasta 27 ppm en texto negro y 15 ppm en texto a color (borrador)\r\nEscáner de 48 bits y 600 x 1200 dpi para ampliaciones de fotos y documentos OCR\r\nRegalo: software para edición de documentos OCR\r\nElimina los ojos rojos, restaura el color y contraste de tus fotos, en un sólo clic desde el driver de la impresora o con Epson Easy Photo Print\r\nImpresión a doble faz manual para ahorrar papel\r\nCon cable USB de regalo\r\n* 4000 es el rendimiento de tinta negra basado en 1 botella de tinta negra solamente. 6500 es el rendimiento basado en botellas de cian, magenta y amarilla solamente. Rendimiento basado en el patrón ISO/IEC 24712, con metodología de EPSON.\r\n** Garantía limitada de 1 año o hasta 15,000 hojas (lo primero que se cumpla). Ver detalles en la documentación del producto.', 'Impresora Multifuncional Epson L210 Sistema De Tinta Todos Los Colores', 'si', 6299.00, 51, 'nuevo', 7),
(30, 'Proyector P-600 Cesio', 'Nuevo proyector CESIO P-600 \r\n- Proyecta imagenes de tv en tiempo real\r\n- Dura 20000 horas el bombillo LED\r\n- Audio Incorporado\r\n\r\nCon el Nuevo proyector CESIO P-600 usted obtendrá  una gran calidad de imagen en sus presentaciones de negocios, medios de enseñanza, cine en casa, KTV de entretenimiento de video, Juegos de consolas (PS2,PS3,XBOX360, …, y PC)\r\n\r\nDisfruta de un entretenimiento increíble en pantalla grande con el Proyector CESIO P-600 para cine en casa o Sport Bar; con este proyector de Alta Definición veras más fácil que nunca: películas, juegos y eventos deportivos en la comodidad de tu lugar de preferencia; así como también, se podrá ver TV en tiempo real.\r\n\r\nEl proyector CESIO P-600 sirve de gran entretenimiento para los más pequeños de la casa en materia de video juegos de consolas o PC. Se sentirán como protagonistas en la acción de los juegos.\r\n\r\nEste proyector es nombrado Producto Verde, debido a la no radiación y contaminación, sin ruido y bajo consumo de energía.\r\n\r\nEs de pequeño tamaño y peso ligero para diversas aplicaciones. \r\n\r\nModelo\r\nCESIO P-600\r\nResolución \r\n800 * 600 admite (1024 * 768)\r\nBrillo de Lámpara\r\n1500 Lúmenes\r\nContraste\r\n800:01:00\r\nSistema de proyector\r\nPantalla LCD TFT de 5 pulgadas\r\nCompatibilidad con Video\r\nNTSC4.43;SECAM;PAL-60,PAL-M,N,(B,D,G,H,I)480i/480P/720P/1080i\r\nMetodos de Proyección  \r\nTecho delantera/ trasera/ techo/ trasera\r\nEntrada\r\nHDMI+ AV in+ VGA+ TV+Svideo+YPbPr/YCbCr\r\nModos de imagen\r\nAdmite la configuración de modo de imagen 4: dinámicas, suave, estándar y personal\r\nIdioma del menu\r\nInglés/español/francés/italiano/alemán y chino\r\nVida de la lámpara LED\r\nUnas 20.000 horas\r\nLente de Proyección\r\nEnfoque manual / enfoque objetivo\r\nCorrección de distorsión  Trapezoidal\r\n+/- 15 Grados\r\nRuido de Audio\r\n<30dB\r\nTamaño de la imagen proyectada\r\n60""-200""\r\nEfecto de sonido\r\nAjuste de bajos y agudos\r\nModo de sonido\r\n4 modos de sonido: Suporte estándar, noticias, música y personales\r\nGarantía \r\nPor un año\r\nPotencia de la lámpara LED\r\n64W\r\nPotencia de salida de Altavoces\r\n3W\r\nPoder consumo total\r\n120W', 'La mejor oferta', 'si', 6990.00, 34, 'nuevo', 7),
(31, 'Reproductor Pioneer Usb Mp3 Wma Fm 2013 Mvh 1050 Garantia', 'ACALAZYAS!!!!\r\nLLEVA A TUS MANOS SUPER OFERTA EN\r\nREPRODUCTOR PIONERR MVH 1050.\r\n\r\nESPECIFICACIONES:\r\n- Reproducción de MP3 / WMA \r\n- Entrada USB 2.0 Frontal\r\n- Entrada de CARD READER, MICRO SD. \r\n- Restaurador de Sonido Avanzado\r\n- RDS (Radio Data System)\r\n- LCD Display\r\n- Volumen giratorio\r\n- NO INCLUYE Control Remoto \r\nNUEVO MODELO 2012 - 2013 . REPRODUCE  MILES DE CANCIONES CON SUS ENTRADAS DE MICRO SD Y MP3 Y USB. \r\nEL EQUIPO NO TIENE ENTRADA PARA CD.\r\n\r\nCON GARANTIA Y FACTURA LEGAL SENIAT!!\r\n\r\n FOTOS REALES DEL PRODUCTO OBSERVESE VISION POSTERIOR\r\n\r\n OBSERVESE VISION SUPERIOR\r\n\r\nEL PAQUETE INCLUYE\r\n \r\nCONDICIONES DE VENTA\r\n\r\n·Los envíos se harán en 24 - 48 horas luego de Confirmado el deposito BANCARIO.\r\n·Los gastos y costos de envío o flete corren por cuenta del comprador.\r\n·Los riesgos inherentes al envío corren por parte del comprador tales como EXTRAVÍO, DESTRUCCIÓN, VIOLACIÓN DE CONTENIDO DE PAQUETE.\r\nPARA OBTENER SU GARANTÍA DEBERÁ DEVOLVER EL PRODUCTO CON TODO SU CONTENIDO, INCLUYENDO LA CAJA EN PERFECTO ESTADO AL IGUAL QUE LA FACTURA DE COMPRA!!!!\r\n·\r\n·Todos los gastos para el envío del producto para hacer efectiva la garantía corren por parte del comprador. TRABAJAMOS CON BANCOS  PROVINCIAL, BANESCO, MERCANTIL\r\nGRACIAS POR SU VISITA Y ESPERAMOS POR SUS OFERTAS!!!!', 'Somos Tienda Fisica Oficina Comercial Mp4 Mp5 Remington', 'si', 868.00, 100, 'nuevo', 1),
