(36, 'Maquina Profesional Para Peluqueria Canina Andis', 'M?quina Profesional para Peluqueria Canina \nMarca Andis\nModelo UltraEdge \nTwo-Speed (2 Velocidades)\n\nMarca Andis\nModelo AGC2\nTwo-Speed (2 Velocidades)\n\nUna de las tareas m?s dif?ciles que hacer como due?o de una mascota es el corte de pelo de su mascota. A veces puede ser una tarea dif?cil, especialmente si usted no tiene ning?n conocimiento previo o la habilidad. La mayor?a recurren a peluqueros caninos profesionales en esta situaci?n. Sin embargo, no siempre es pr?ctico para la mayor?a de los due?os de los animales para ir a un peluquero canino. Si usted est? mirando para ahorrar dinero o simplemente ser m?s pr?ctico con su mascota, ?por qu? no hacerlo usted mismo?. Para aquellos que est?n pensando en hacer su aseo personal por s? mismos, una maquinilla va a ser una buena inversi?n. Una de las opciones que usted puede mirar es el Andis UltraEdge AGC Super 2-Speed Clipper animal o la Andis AGC2.\n\nAMBAS MAQUINAS VIENEN CON UNA HOJILLA INSTALADA', 'Modelos Agc2 Y Ultraedge 2 Velocidades!!', 'si', 3.00, 8, 'nuevo', 2),
(37, 'Garrocha Electrica Para Ganado Y Cerdo', 'Descripci?n del producto:\n\nFue dise?ado con la finalidad primordial de movilizar su ganado, facilitando asi su traslado de forma segura actualmente la tenemos en una unica presentacion de 90cm.\n\nCARACTERISTICAS:\n\nCarcasa:  Est? hecha de pl?stico, que NO permite conducir la electricidad. es de unos pocos mil?metros de espesor y est? hecho de materiales que poseen una rigidez diel?ctrica de 20,000 V por mm, capaz de aislar el voltaje de descarga incluso de iones de la superficie de los electrodos\n\nSalida de voltaje:La tensi?n de salida depende de una serie de factores, incluyendo la atm?sfera y carga de la bater?a. por razones de precauci?n, al dise?ar el aislamiento de la carcasa, el valor pico se tom? como 2500 v. aunque este valor se ha elegido porque es insuficiente para producir da?o irreversible, el dispositivo s?lo debe ser utilizado por expertos cuidadores de animales.\n\nElectrodos: Son las puntas de las pinzas que se colocan contra los animales para producir el efecto de aturdimiento. la distancia entre las puntas es tal como para evitar las chispas entre los electrodos. el dispositivo no debe utilizarse en una atm?sfera h?meda, donde existe el riesgo de un incendio o en presencia de gases potencialmente explosivos.', 'La mejor oferta esta aqu', 'si', 1250.00, 5, 'nuevo', 2),
(38, 'Roca Para Acuarios De Ciclidos Y Marinos', 'Fragmentos de coral fosilizado  que se han curado durante meses naturalmente sin ning?n tratamiento qu?mico tomando as? su caracter?stico y bello color blanco.\n\nS?per porosas, ornamentales, ideales para ser utilizadas en acuarios de agua dulce, en especial de Ciclidos Africanos ayudando a mantener el PH alcalino del agua.\n\nTambi?n para acuarios Marinos ya sea directamente en los acuarios o como elemento del sump donde en pocas semanas comienza su proceso de colonizaci?n y coloraci?n, necesarias para dar cobijo a distintas cepas bacterianas del Ciclo del Nitr?geno para que transformen el amonio en Nitritos, estos ?ltimos en Nitratos y finalmente, en nitr?geno gas. \n\nDe diferentes tama?os de acuerdo a las necesidades del cliente.\nEl precio es por kilogramo\n\nEn las foto inferior se puede apreciar la colonizaci?n de estas rocas al permanecer seis semanas en un acuario marino\n  \nTenemos tambi?n grandes piezas con grietas y orificios que sirven de cueva o escondite a los peces peque?os con precios dependiendo del tama?o.', 'Excelentes Para Acuarios De Ciclidos Africanos', 'si', 30.00, 37, 'nuevo', 2),
(39, 'Verdaderos Poodles Microtoys, Realmente Garantizados', 'OFRECEMOS LO QUE REALMENTE UD ESTA BUSCANDO, UN EJEMPLAR OPTIMO!!! CON LAS MEJORES CARACTERISTICAS POSIBLES DE LA RAZA, CONTROLES GENETICOS Y SANITARIOS, UNA ALIMENTACION BALANCEADA,CONTROLES DE VACUNAS Y DESPARASITACIONES CERTIFICADAS,Y SOBRE TODO GARANTIZADOS!!! SATISFACIENDO ASI LAS NECESIDADES DE  TODOS UDS NUESTROS FUTUROS Y POTENCIALES CLIENTES.\n\nDISPONEMOS DE EJEMPLARES  DE CRIA DE  EXCELENTES LINEAS, SANGRES IMPORTADAS, RELEVANTES CAMPEONES NACIONALES E INTERNACIONALES, LLEVANDO ANTE ESTE MERCADO UN PRODUCTO DE ALTA CALIDAD Y BELLEZA. DIVERSIDAD DE COLORES APRICOT, CHAMPAG?E, BLANCOS,GRISES Y CHOCOLATES.\n\nNUESTROS COSTOS DADA LA CALIDAD QUE OFRECEMOS PODEMOS DECIR QUE SON ALTAMENTE COMPETITIVOS, YA QUE SU COSTO ES DE 1800BS LOS EJEMPLARES TANTO HEMBRAS COMO MACHOS, LOS MISMOS NO POSEEN REGISTRO. SI UD DESEA UN EJEMPLAR CON PEDIGREE OCACIONALMENTE OFRECEMOS, PERO SU COSTO ES MUCHO MAYOR.\n', 'Por Algo Somos Lideres!!! Comparen.. Somos Centro Veterinario!', 'si', 1800.00, 89, 'nuevo', 2),
